//Day night system

const lamp = document.getElementById("lamp");
const body = document.getElementById("body");

const switchif = (yondimi) => {
  console.log(yondimi);
  if (yondimi) {
    body.classList.add("dark");
  } else {
    body.classList.remove("dark");
  }
};

let a = localStorage.getItem("lamp");
switchif(a == "true");
lamp.checked = a == "true";

const switchLamp = () => {
  switchif(lamp.checked);
  localStorage.setItem("lamp", lamp.checked);
};
